DESCRIPTION:
Sveiki,

daugybę metų prie Žemynos g. 18 esančio prekybos centro, pietinėje dalyje šalia Laisvės pr. ir Žemynos gatvių jungiamosios gatvelės esančiame plote vyrauja nesusipratimai su automobilių parkavimu ir pėsčiųjų srautais. 

Galima būtų išskirti tokias problemas:
- Nėra aiškiai atskira dalis pėstiesiems ir automobiliams, sunku praeiti, nors vietos atskirti yra pakankamai;
- Chaotiškas parkavimas (ratų atmušėjai yra įrengti, tačiau skirtingu atstumu nuo pastato, taip pat ir laukiantys klientų taksi automobiliai užstato kitus automobilius, jiems trukdo išvažiuoti);
- Pėsčiųjų srautas nepatrauktas toliau nuo važiuojamosios kelio dalies, išvis neaiškus;
- Įsikūrę verslai (pvz., užkandinė) neturi patogaus priėjimo ir negalėtų išsiimti leidimo lauko staliukams įsirengti vasaros metu (o galimai svarstytų, nes klientų kiekis didžiulis); 
- Dėl sudėtingos situacijos beveik nevyksta sniego valymas žiemą (traktoriai nepravažiuoja, o jei ir pravažiuoja, nuvalyta dalis netrukus užstatoma vairuotojų ar apnešama sniegu nuo automobilių ratų);
- Kai kurie automobiliai išvažiuoja į priešingą pusę (bando išvažiuoti į sankryžą neapsisukę į kitą jungiamosios gatvelės dalį), tad sukelia avarines situacijas.

Kaip miesto gyventojas, kasdien einantis pro šią vietą ir matantis pastovų chaosą, norėčiau pasiūlyti paprastą sprendimo būdą, kuriam nereikėtų didelių lėšų ar pertvarkymo projektų, be to, tai būtų galima padaryti nors ir dabar, žiemą, ir tai iškart sutvarkytų šią lokaciją. Esmė būtų perkelti esamus ratų atmušėjus, kartu perkeliant ir stovėjimo vietas (jų skaičiaus nesumažinant), arčiau jungiamosios gatvelės, erdvę tarp pastato ir stovėjimo vietų paliekant pėstiesiems. Vėliau norint būtų galima įrengti papildomas eismo ribojimo priemones (stulpelius) šiai zonai apsaugoti nuo automobilius neleistinoje vietoje norinčių palikti vairuotojų.

Kodėl būtent toks siūlomas variantas išspręstų minėtas problemas:
- Atsirastų aiškus pėsčiųjų tako ir parkingo vietų atskyrimas;
- Pėsčiųjų srautas būtų patrauktas toliau nuo važiuojamosios kelio dalies (saugumas);
- Pėsčiųjų takas sujungtų perėją Žemynos g. su perėja Laisvės prospekte patogiau - tiesiu keliu, pėstiesiems nebereikėtų laviruoti tarp netvarkingai statomų automobilių;
- Nesumažėtų stovėjimo vietų automobiliams;
- Taptų paprasta nuvalyti sniegą nuo pėsčiųjų tako - plotis būtų pakankamas traktoriui pravažiuoti, galėtų patogiai užvažiuoti pro bet kurią pėsčiųjų perėją;
- Pasukus automobilių stovėjimo vietas šiek tiek kampu, vairuotojai privalėtų išvažiuoti atbuli ir apsisukti į kitą jungiamosios gatvelės dalį norėdami išvažiuoti į Laisvės prospektą, tad nebesukeltų avarinių situacijų.

Kad būtų aiškiau, pridedu schemą su siūlymu šios vietos problemoms išspręsti. Prašau apsvarstyti šį variantą, nes tai iškart pagerintų susisiekimą tiek pėsčiomis keliaujantiems miestiečiams, tiek ir vairuotojams, kurių automobilius neleistinai vis užstato neatsakingi vairuotojai.

Dar kartą primenu, kad tai nesumažintų esamų parkavimo vietų skaičiaus, o pradiniam sprendimui įgyvendinti tereikėtų perkelti šiuo metu bet kaip aikštelėje įrengtus ratų atmušėjus į kitą vietą.

